import React from "react";
import "./App.css";

const Scorpion = () => {
    return (
        <>
            <div className="container">
                <div className="row">
                    <div className="col-8"></div>
                    <div className="col-4" id="latestVersion"></div>
                </div>
            </div>
            <h1>SCORPION</h1>
        </>
    );
};
export default Scorpion;
